import logo from './logo.svg';
import './App.css';
import PayrollForm from './components/payroll-form/payroll-form'
import {
  BrowserRouter as Router,
  Switch,
  Route,Redirect
} from "react-router-dom"
import DisplayMessage from './components/displayMessage/display-message';


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={PayrollForm}/>
          <Route exact path="/" component={DisplayMessage}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
